type props = {
    types: {
        value: {}
    },
    sortBy: {
        value: {}
    },
    props: {
        value: {}
    },
    // sortBy: string | null,
    // props: string[] | null
}

export default async function getCurrentProducts ({types, sortBy, props}: props) {

    console.log({
        types: types.value, 
        sortBy: sortBy.value, 
        props: props.value
    });
    
    const request = fetch('http://localhost:5000/api/products/currentProducts', {
        method: 'POST',
        body: JSON.stringify({
            types: types, 
            sortBy: sortBy, 
            props: props
        })
    });

    return (await request).json();
};
